const SecurityE = () => {
  return (
    <div className="security_experts">
      <p>Our cyber security exports are from...</p>

      <div className="security_imgs"></div>
      <img src={require('./images/google.svg-1.webp')} alt="Google" />
      <img src="../images/microsoft.png" alt="Microsoft" />
      <img src="../images/Apple.svg" alt="Apple" />
      <img src="../images/facebook.png" alt="Facebook" />
    </div>
  )
}
export default SecurityE
